const imgs=[
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,',
	'https://th.bing.com/th/id/OIP.ux4DVM792mMqkNiQq1Q1vwHaGl?w=223&h=198&c=7&r=0&o=5&dpr=1.7&pid=1.7',
	'https://th.bing.com/th/id/OIP.PmOroqig_gjS0tdm4cZ-qQHaE8?w=276&h=184&c=7&r=0&o=5&dpr=1.7&pid=1.7'
];
const imgcont= document.querySelector('#img-cont');
const verify = document.querySelector('#verify');
const reset = document.querySelector('#reset');
let selected = [];

function imgren(){
	let imgtorend=[];
	imgcont.innerHTML = '';
	reset.style.display='none';
	verify.style.display='none';
	selected = [];
	imgtorend=[...imgs,imgs[Math.floor(Math.random()*imgs.length)]];
	imgtorend.sort(()=>{
		return Math.random()-0.5;
	});
	imgtorend.forEach((e,ind)=>{
		let im = document.createElement('img');
		im.setAttribute('src',e);
		im.setAttribute('alt',`Image-${ind}`);
		im.classList.add('img-c');
		imgcont.appendChild(im);
	});
}
imgcont.addEventListener('click',(e)=>{
	if (e.target.tagName === 'IMG') {
	e.target.classList.add('selected');
	selected.push(e.target);
	if(selected.length===1){
		reset.style.display='block';
	}
	if(selected.length===2){
		verify.style.display='block';
	}
	}
});
window.onload=()=>{
	imgren();
}
reset.addEventListener('click',()=>{
	imgren();
});
verify.addEventListener('click',()=>{
	let a = selected[0].getAttribute('src');
	let b = true;
	selected.forEach((e)=>{
		if(e.getAttribute('src')!==a) b = false;
	});
	if(b){
		document.getElementById('msg').innerText='You are a human. Congratulations!';
	}else{
		document.getElementById('msg').innerText="We can't verify you as a human. You selected the non-identical tiles";
	}
})











